const animateOcc2 = (layers: Array<FeatureLayer>) => {
  if (occStepCount == 0) {
    layers[1].visible = false;
    layers[2].visible = false;
  }
  for (let i = 0; i < layers.length; i++) {
    if (i === occStepCount) {
      layers[i].visible = true;
    } 
  }

  occStepCount++;
  if (occStepCount == 3) {
    occStepCount = 0;
  }

}
 
   
  

let intervalHandler: number;

